// components/ComparisonChart/ComparisonChart.js

import React from 'react';
import './ComparisonChart.css';
import Button from '../Button/Button';

const comparisonData = [
  {
    feature: 'Responsive Design',
    freshman: 'Yes',
    primeTime: 'Yes',
    mogul: 'Yes',
    legendary: 'Yes',
  },
  {
    feature: 'Custom Pages',
    freshman: '3 Pages',
    primeTime: '10 Pages',
    mogul: '20+ Pages',
    legendary: 'Fully Custom',
  },
  {
    feature: 'E-Commerce',
    freshman: 'No',
    primeTime: 'Basic',
    mogul: 'Advanced',
    legendary: 'Enterprise',
  },
  {
    feature: 'SEO Optimization',
    freshman: 'Basic',
    primeTime: 'On-Page',
    mogul: 'Advanced',
    legendary: 'Full Service',
  },
  {
    feature: 'Support',
    freshman: 'Limited',
    primeTime: 'Standard',
    mogul: 'Ongoing',
    legendary: 'Dedicated',
  },
];

const ComparisonChart = ({ selectedTier, onSelectTier }) => {
  return (
    <div className="comparison-chart">
      <h3>Compare Our Packages</h3>
      <div className="chart-actions">
        <Button
          onClick={() => onSelectTier('Freshman')}
          label="Freshman"
        />
        <Button
          onClick={() => onSelectTier('Prime Time')}
          label="Prime Time"
        />
        <Button onClick={() => onSelectTier('Mogul')} label="Mogul" />
        <Button
          onClick={() => onSelectTier('Legendary')}
          label="Legendary"
        />
      </div>
      <table>
        <thead>
          <tr>
            <th>Features</th>
            <th>Freshman</th>
            <th>Prime Time</th>
            <th>Mogul</th>
            <th>Legendary</th>
          </tr>
        </thead>
        <tbody>
          {comparisonData.map((row, index) => (
            <tr key={index}>
              <td>{row.feature}</td>
              <td>{row.freshman}</td>
              <td>{row.primeTime}</td>
              <td>{row.mogul}</td>
              <td>{row.legendary}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ComparisonChart;
